import React, {useState, useEffect} from 'react'
import axios from 'axios'

function DataFetching() {

    const [items, setItems] = useState([]);

    useEffect(() => {
        axios
        .get('https://pastebin.com/raw/tHK62mvk')
        .then(res => {
            console.log(res)
            setPosts(res.data)
        })
        .catch(err => {
            console.log(err)
        })

    }
    )

    return (
        <div>
            <ul>
                {items.map(item => (
                <li key={item.id}>
                    {item.name} {item.price}
                </li>
                ))}
            </ul>
        </div>
    )
}

export default DataFetching
